import React from 'react';
import '../css/DeleteAccountConfirmMenu.css';
import Account from './account.js';

class DeleteAccountConfirmMenu extends React.Component {

    render() {
        return (
            <div>
                <h3 className="DeleteAccountPrompt">Are you sure you want to delete this account?</h3>
                <div className="AccountContainer">
                    <Account />
                </div>
                <div className="BtnContainer">
                    <div className="UnlinkAccountsBtn">Unlink Account</div>
                    <div className="UnlinkAccountsBtn">Cancel</div>

                </div>
            </div>
        );
    }
}

export default DeleteAccountConfirmMenu;
